 - modelposition;  // Compute the direction in which the light source lies\n    \n    gl_Position = u_ViewProj * modelposition;// gl_Position is a built-in variable of OpenGL which is\n    // used to render the final positions of the geometry's vertices\n    \n}\n"},4742:e=>{e.exports="#version 300 es\n\n// This is a fragment shader. If you've opened this file first, please\n// open and read lambert.vert.glsl before reading on.\n// Unlike the vertex shader, the fragment shader actually does compute\n// the shading of geometry. For every pixel in your program's output\n// screen, the fragment shader is run for every bit of geometry that\n// particular pixel overlaps. By implicitly interpolating the position\n// data passed into the fragment shader by the vertex shader, the fragment shader\n// can compute what color to apply to its pixel based on things like vertex\n// position, light position, and vertex color.\nprecision highp float;\n\nuniform vec4 u_Color; // The color with which to render this instance of geometry.\nuniform vec4 u_SecondaryColor; // The color with which to render this instance of geometry.\n\nuniform vec4 u_CameraPos; // The color with which to render this instance of geometry.\nuniform int u_NumericalNorm;\nuniform float u_CityThreshold;\n// These are the interpolated values out of the rasterizer, so you can't know\n// their specific values without knowing the vertices that contributed to them\nin vec4 fs_Nor;\nin vec4 fs_LightVec;\nin vec4 fs_Col;\nin vec4 fs_WorldPos;\nin vec4 fs_LightPos;\nin vec4 fs_Pos;\nin mat3 fs_TBN;\nuniform float u_OceanThreshold;\n\nuniform vec2 u_MousePos;\n\nuniform float u_Time;\nout vec4 out_Col; // This is the final output color that you will see on your\n// screen for the pixel that is currently being processed.\n\nvec3 hash3Vec3(vec3 v) {\n    return fract(sin(vec3(v.x * 10235.124, v.y * 38119.333333, v.z * 9199.2)));\n\n}\nfloat hash3(vec3 v)\n{\n    return fract(sin(dot(v, vec3(24.51853, 4815.44774, 32555.33333))) * 3942185.3);\n}\n\nvec4 noise3(vec3 v)\n{\n    //Adapted from IQ: https://www.iquilezles.org/www/articles/morenoise/morenoise.htm\n    vec3 intV = floor(v);\n    vec3 fractV = fract(v);\n    vec3 u = fractV*fractV*fractV*(fractV*(fractV*6.0-15.0)+10.0);\n    vec3 du = 30.0*fractV*fractV*(fractV*(fractV-2.0)+1.0);\n    \n    float a = hash3( intV+vec3(0.f,0.f,0.f) );\n    float b = hash3( intV+vec3(1.f,0.f,0.f) );\n    float c = hash3( intV+vec3(0.f,1.f,0.f) );\n    float d = hash3( intV+vec3(1.f,1.f,0.f) );\n    float e = hash3( intV+vec3(0.f,0.f,1.f) );\n    float f = hash3( intV+vec3(1.f,0.f,1.f) );\n    float g = hash3( intV+vec3(0.f,1.f,1.f) );\n    float h = hash3( intV+vec3(1.f,1.f,1.f) );\n    \n    float k0 =   a;\n    float k1 =   b - a;\n    float k2 =   c - a;\n    float k3 =   e - a;\n    float k4 =   a - b - c + d;\n    float k5 =   a - c - e + g;\n    float k6 =   a - b - e + f;\n    float k7 = - a + b + c - d + e - f - g + h;\n    \n    \n    vec3 dv = 2.0* du * vec3( k1 + k4*u.y + k6*u.z + k7*u.y*u.z,\n                             k2 + k5*u.z + k4*u.x + k7*u.z*u.x,\n                             k3 + k6*u.x + k5*u.y + k7*u.x*u.y);\n    \n    return vec4(-1.f+2.f*(k0 + k1*u.x + k2*u.y + k3*u.z + k4*u.x*u.y + k5*u.y*u.z + k6*u.z*u.x + k7*u.x*u.y*u.z), dv);\n}\n\nvec4 fbm3(vec3 v, int octaves, float amp, float freq, float pers, float freq_power)\n{\n    vec2 center_MousePos = 2.f * (u_MousePos - 0.5f);\n    float sum = 0.f;\n    vec3 dv = vec3(0.f,0.f,0.f);\n    float speed = 0.01f;\n    for(int i = 0; i < octaves; ++i)\n    {\n        amp *= pers;\n        freq *= freq_power;\n        vec4 noise = noise3((v) * freq);\n        sum += amp * noise.x;\n        dv += amp * noise.yzw;\n    }\n    return vec4(sum, dv);\n}\n\nfloat getBias(float t, float bias)\n{\n    return t / ((((1.f / bias) - 2.f * (1.f - t)) + 1.f));\n}\n\nfloat squareWave(float x, float freq, float amplitude, float modVal) {\n    return abs(mod(floor(x * freq), modVal) * amplitude);\n}\n\nfloat cubeWave(vec3 p, float freq, float amplitude, float freqJitter, float ampJitter, float modVal)\n{\n    vec3 floorP = floor(p);\n    float jitter = hash3(floorP);\n    float amp = amplitude + jitter * ampJitter;\n    float f = freq + jitter * freqJitter;\n    return squareWave(p.x, f, amp, modVal) * squareWave(p.y, f, amp, modVal) * squareWave(p.z, f, amp, modVal);\n}\n\nvec3 randomColor(vec3 p, float freq)\n{\n    return hash3Vec3(floor(freq * p));\n}\n\nvoid main()\n{\n    \n    // Material base color (before shading)\n    vec4 diffuseColor = vec4(1.0,1.0,1.0,1.0);\n    vec3 offset = vec3(20.f); //sin(u_Time * 0.002) * (1.f + 3.f * fs_Nor.xyz);\n    vec4 fbm = fbm3(fs_Pos.xyz * 0.4, 4, 0.8f, 1.4f, 0.8f, 2.f);\n    vec4 fbm_color = fbm3(fs_Pos.xyz * 2.0, 4, 0.8f, 1.9f, 0.8f, 2.f);\n    fbm_color.x = clamp(0.5 * fbm_color.x + 0.5,0.0,1.0);\n    vec4 norm = vec4(fs_TBN * fs_Nor.xyz, 0.0);\n     norm = fs_Nor;\n    float light_dist = 1.0 ;//distance(fs_LightPos, fs_WorldPos);\n    float pointlightIntensity = 1.f / (light_dist * light_dist);\n    float fbm_lerp = 0.04f;\n    vec4 lightVec = normalize(fs_LightPos - fs_WorldPos);\n    \n    \n//    diffuseColor.xyz = mix(u_SecondaryColor.xyz, u_Color.xyz, clamp((fbm_col.x + 1.0) * 0.5, 0.0, 1.f));\n\n    vec3 pole1 = vec3(0.0, 0.5, 0.0);\n    vec3 pole2 = vec3(0.0, -0.5, 0.0);\n\n    float ks = 0.0;\n    float kd = 1.0;\n\n    float cosPow = 0.f;\n    float fbm_norm = (fbm.x + 1.0) * 0.5;\n    \n    vec3 mountainColor = mix(vec3(0.8f, 0.8f, 0.75f), vec3(0.4f, 0.4f, 0.5f), fbm_color.x);\n    vec3 beachColor = vec3(0.4f, 0.6f, 0.f);\n    vec3 vegColor = vec3(0.73, 0.9f, 0.72f);\n    vec3 seaColor = vec3(0.4f, 0.79f, 0.9f);\n    vec3 snowColor = vec3(1.0f, 1.0f, 1.0f);\n\n    // Colors of each biome.\n    float thresholds[5] = float[5](u_OceanThreshold - 0.8, u_OceanThreshold - 0.1, u_OceanThreshold, u_OceanThreshold + 1.0, u_OceanThreshold + 1.0);\n\n    float height = length(fs_WorldPos);\n    \n\n    if(fbm_norm < thresholds[1]) {\n        // land\n        float a = (fbm_norm - thresholds[0])\n        / (thresholds[1] - thresholds[0]);\n        vec4 streetColor = vec4(0.0,0.0,0.0,1.0);\n        vec4 fbm_land_biomes = fbm3(fs_WorldPos.xyz * 0.3 + vec3(0.4, 0.1, -20.0), 3, 0.8f, 1.6f, 0.8f, 2.f);\n        fbm_land_biomes.x = 0.5 + 0.5 * fbm_land_biomes.x;\n        if(fbm_land_biomes.x < u_CityThreshold) {\n            float city_col = cubeWave(fs_WorldPos.xyz + sin(fs_WorldPos.xyz), 7.0, 0.9, 6.0, 0.0, 1.45);\n            float building_col = cubeWave(fs_WorldPos.xyz + sin(fs_WorldPos.xyz), 50.0, 5.0, 6.0, 1.0, 2.0);\n            ks = 0.1;\n            float lit = city_col > 0.1 ? 1.0 : 0.0;\n            vec3 col = lit * building_col * city_col * randomColor(fs_WorldPos.xyz + sin(fs_WorldPos.xyz), 8.9) + vec3(0.2);\n          //  vec3 randCol = city_col\n            //city_col = city_col > 0.0 ? 1.0 : 0.0;\n            diffuseColor.xyz = col;\n            cosPow = 120.f;\n\n            //city\n        } else {\n            //nature\n            vec4 fbm_hills = fbm3(fs_Pos.xyz * 0.6 + 0.5, 3, 0.8f, 1.6f, 0.8f, 2.f);\n            fbm_hills.x = 0.5 + 0.5 * fbm_hills.x;\n            diffuseColor.xyz = vegColor;\n\n            if(height > 1.44)\n            {\n                diffuseColor.xyz = mountainColor;\n            }\n            \n        }\n        \n        if(fbm_norm > thresholds[1] - 0.01){\n            diffuseColor.xyz = vec3(1.0);\n        }\n       // diffuseColor.xyz = mix(diffuseColor.xyz, beachColor.xyz, a);\n\n\n    }\n    \n    if (fbm_norm >= thresholds[1] && fbm_norm < thresholds[2])\n    {\n        // beaches\n        float a = (fbm_norm - thresholds[1])\n        / (thresholds[2] - thresholds[1]);\n        //a = getBias(a, 0.2);\n        diffuseColor.xyz = mix(diffuseColor.xyz, beachColor, a + 0.4);\n        //ks = 0.1f;\n        kd = 0.7;\n        \n        // Snow\n        float poledist = 1.f - (min(distance(fs_Pos.xyz, pole1), distance(fs_Pos.xyz, pole2)))\n        + 0.05 * sin(fs_Pos.x) + 0.025 * sin(4.0 * fs_Pos.x);\n        float mixterm = clamp(poledist * 2.0, 0.f, 1.f);\n        diffuseColor.xyz = mix(diffuseColor.xyz, snowColor, mixterm);\n        ks = mix(0.2f, 0.5f,  mixterm);\n        kd = 0.6;\n        cosPow = mix(3.f, 129.f,  mixterm);\n\n\n    }\n    \n    if (fbm_norm >= thresholds[2] && fbm_norm < thresholds[3]) {\n        // water\n        float a = (fbm_norm - thresholds[2])\n        / (thresholds[3] - thresholds[2]);\n        a = clamp(a * 2.0, 0.0, 1.0);\n        //a = clamp(a + 0.5, 0.0, 1.0);\n        //a = getBias(a * 5.0, 0.99);\n        diffuseColor.xyz = mix(diffuseColor.xyz, seaColor, a * 2.0);\n        //diffuseColor.xyz = vec3(a);\n        cosPow = 128.f;\n        ks = 0.9f;\n        //norm.xyz += 0.06 * sin(u_Time * 0.01) * norm.xyz;\n    } else if (fbm_norm >= thresholds[3] && fbm_norm < thresholds[4]) {\n        float a = (fbm_norm - thresholds[4])\n        / (thresholds[4] - thresholds[3]);\n        // polar\n        diffuseColor.xyz = vec3(0.9f, 0.9f, 0.9f);\n    }\n\n    float diffuseTerm = pointlightIntensity * dot(normalize(norm), normalize(lightVec));\n    // Avoid negative lighting values\n    diffuseTerm = clamp(diffuseTerm, 0.f, 1.f);\n    float ambientTerm = 0.3;\n    vec4 viewVec = normalize(fs_WorldPos - u_CameraPos);\n    vec4 h = normalize(lightVec - viewVec);\n    \n    float specularIntensity = pointlightIntensity * max(pow(max(dot(h, norm), 0.f), cosPow), 0.f);\n\n    float lightIntensity = clamp((diffuseTerm * kd + ambientTerm + specularIntensity * ks), 0.f, 3.f);\n    vec4 lightColor = vec4(255.f, 245.f, 228.f, 255.f) / 255.f;\n    out_Col = vec4(diffuseColor.xyz * lightIntensity * lightColor.xyz, diffuseColor.a);\n    //out_Col = vec4(norm.xyz, 1.0);\n}\n"},9523:e=>{e.exports="#version 300 es\n\n//This is a vertex shader. While it is called a \"shader\" due to outdated conventions, this file\n//is used to apply matrix transformations to the arrays of vertex data passed to it.\n//Since this code is run on your GPU, each vertex is transformed simultaneously.\n//If it were run on your CPU, each vertex would have to be processed in a FOR loop, one at a time.\n//This simultaneous transformation allows your program to run much faster, especially when rendering\n//geometry with millions of vertices.\n\nuniform float u_Time;\nuniform float u_CityThreshold;\nuniform float u_OceanThreshold;\n\nuniform vec2 u_MousePos;\nuniform vec4 u_CameraPos;\n\nuniform mat4 u_Model;       // The matrix that defines the transformation of the\n// object we're rendering. In this assignment,\n// this will be the result of traversing your scene graph.\n\nuniform mat4 u_ModelInvTr;  // The inverse transpose of the model matrix.\n// This allows us to transform the object's normals properly\n// if the object has been non-uniformly scaled.\n\nuniform mat4 u_ViewProj;    // The matrix that defines the camera's transformation.\n// We've written a static matrix for you to use for HW2,\n// but in HW3 you'll have to generate one yourself\n\nuniform mat4 u_ViewProjInv;    // The matrix that defines the camera's transformation.\n// We've written a static matrix for you to use for HW2,\n// but in HW3 you'll have to generate one yourself\n\nin vec4 vs_Pos;             // The array of vertex positions passed to the shader\n\nin vec4 vs_Nor;             // The array of vertex normals passed to the shader\n\nin vec4 vs_Col;             // The array of vertex colors passed to the shader.\n\nout vec4 fs_Nor;            // The array of normals that has been transformed by u_ModelInvTr. This is implicitly passed to the fragment shader.\nout vec4 fs_WorldPos;\nout vec4 fs_Pos;\n\nout vec4 fs_LightVec;       // The direction in which our virtual light lies, relative to each vertex. This is implicitly passed to the fragment shader.\nout vec4 fs_LightPos;       // The direction in which our virtual light lies, relative to each vertex. This is implicitly passed to the fragment shader.\n\nout vec4 fs_Col;            // The color of each vertex. This is implicitly passed to the fragment shader.\n\nout mat3 fs_TBN;\n\nconst vec4 lightPos = vec4(0.0, 5.0, 3.0, 1); //The position of our virtual light, which is used to compute the shading of\n//the geometry in the fragment shader.\n\n\nfloat hash3(vec3 v)\n{\n    return fract(sin(dot(v, vec3(24.51853, 4815.44774, 32555.33333))) * 3942185.3);\n}\n\nvec4 noise3(vec3 v)\n{\n    //Adapted from IQ: https://www.iquilezles.org/www/articles/morenoise/morenoise.htm\n    vec3 intV = floor(v);\n    vec3 fractV = fract(v);\n    vec3 u = fractV*fractV*fractV*(fractV*(fractV*6.0-15.0)+10.0);\n    vec3 du = 30.0*fractV*fractV*(fractV*(fractV-2.0)+1.0);\n    \n    float a = hash3( intV+vec3(0.f,0.f,0.f) );\n    float b = hash3( intV+vec3(1.f,0.f,0.f) );\n    float c = hash3( intV+vec3(0.f,1.f,0.f) );\n    float d = hash3( intV+vec3(1.f,1.f,0.f) );\n    float e = hash3( intV+vec3(0.f,0.f,1.f) );\n    float f = hash3( intV+vec3(1.f,0.f,1.f) );\n    float g = hash3( intV+vec3(0.f,1.f,1.f) );\n    float h = hash3( intV+vec3(1.f,1.f,1.f) );\n    \n    float k0 =   a;\n    float k1 =   b - a;\n    float k2 =   c - a;\n    float k3 =   e - a;\n    float k4 =   a - b - c + d;\n    float k5 =   a - c - e + g;\n    float k6 =   a - b - e + f;\n    float k7 = - a + b + c - d + e - f - g + h;\n    \n    \n    vec3 dv = 2.0* du * vec3( k1 + k4*u.y + k6*u.z + k7*u.y*u.z,\n                             k2 + k5*u.z + k4*u.x + k7*u.z*u.x,\n                             k3 + k6*u.x + k5*u.y + k7*u.x*u.y);\n    \n    return vec4(-1.f+2.f*(k0 + k1*u.x + k2*u.y + k3*u.z + k4*u.x*u.y + k5*u.y*u.z + k6*u.z*u.x + k7*u.x*u.y*u.z), dv);\n}\n\nvec4 fbm3(vec3 v, int octaves, float amp, float freq, float pers, float freq_power)\n{\n    vec2 center_MousePos = 2.f * (u_MousePos - 0.5f);\n    float sum = 0.f;\n    vec3 dv = vec3(0.f,0.f,0.f);\n    float speed = 0.01f;\n    for(int i = 0; i < octaves; ++i)\n    {\n        amp *= pers;\n        freq *= freq_power;\n        vec4 noise = noise3((v) * freq);\n        sum += amp * noise.x;\n        dv += amp * noise.yzw;\n    }\n    return vec4(sum, dv);\n}\n\n\nfloat squareWave(float x, float freq, float amplitude, float modVal) {\n    return abs(mod(floor(x * freq), modVal) * amplitude);\n}\n\nfloat cubeWave(vec3 p, float freq, float amplitude, float freqJitter, float ampJitter, float modVal)\n{\n    vec3 floorP = floor(p);\n    float jitter = hash3(floorP);\n    float amp = amplitude + jitter * ampJitter;\n    float f = freq + jitter * freqJitter;\n    return squareWave(p.x, f, amp, modVal) * squareWave(p.y, f, amp, modVal) * squareWave(p.z, f, amp, modVal);\n}\n\n\nfloat getOffset(vec3 p)\n{\n    vec4 fbm = fbm3(p * 0.4, 4, 0.8f, 1.4f, 0.8f, 2.f);\n\n    float fbm_norm = (fbm.x + 1.0) * 0.5;\n    float height = 0.f;\n    float offset = 0.f;\n    float thresholds[5] = float[5](u_OceanThreshold - 0.6, u_OceanThreshold - 0.1, u_OceanThreshold, u_OceanThreshold + 1.0, u_OceanThreshold + 1.0);\n\n    if(fbm_norm < thresholds[1]) {\n        //  land\n        vec4 fbm_land_biomes = fbm3(p * 0.3 + vec3(0.4, 0.1, -20.0), 3, 0.8f, 1.6f, 0.8f, 2.f);\n        fbm_land_biomes.x = 0.5 + 0.5 * fbm_land_biomes.x;\n\n        if(fbm_land_biomes.x < u_CityThreshold) {\n            height =  0.12 * cubeWave(p.xyz + sin(p.xyz), 7.0, 0.9, 6.0, 0.2, 1.45);\n            \n            //city\n        } else {\n            //nature\n            vec4 fbm_hills = fbm3(p * 0.9 + 0.5, 3, 0.8f, 1.6f, 0.8f, 2.f);\n            fbm_hills.x = 0.5 + 0.5 * fbm_hills.x;\n            height = fbm_hills.x * 0.3;\n            \n        }\n        float pos = (fbm_norm - thresholds[0]) / (thresholds[2] - thresholds[0]);\n        pos = clamp((pos - 0.5), 0.0, 1.0) / 0.5;\n        height = mix(height, 0.0, pos);\n        \n    } else if (fbm_norm < thresholds[2]) {\n        // beach\n        float pos = (fbm_norm - thresholds[0]) / (thresholds[2] - thresholds[0]);\n        height = 0.0;\n    } else if (fbm_norm < thresholds[3]) {\n        //water\n        float pos = (fbm_norm - thresholds[2]) / (thresholds[3] - thresholds[2]);\n        height = -0.06;\n        vec3 freq = 2.0 * (p + vec3(abs(sin(u_Time * 0.001))));\n        offset = 0.05 * fbm3(freq, 2, 0.8f, 1.6f, 0.3f, 2.f).x;\n        freq = 3.0 * (p - vec3(abs(10.0 + cos(0.5 + u_Time * 0.0009))));\n        offset += 0.05 * fbm3(freq, 2, 0.8f, 1.6f, 0.3f, 2.f).x;\n    } else {\n        // islands\n        float pos = (fbm_norm - thresholds[3]) / (thresholds[4] - thresholds[3]);\n        height = 0.01 * pos;\n    }\n    \n    float polesize = 0.2;\n\n//    if(abs(p.y) > 0.8)\n//    {\n//        float pole_closeness = (abs(p.y) - 0.8) / 0.2;\n//        vec4 fbm_ice = fbm3(p * 0.4, 3, 0.8f, 1.6f, 0.8f, 2.f);\n//        fbm_ice.x = (fbm_ice.x + 1.0) * 0.5;\n//        return mix(height, fbm_ice.x * 0.3, pole_closeness * fbm_norm);\n//    }\n    \n    return height - offset;\n}\n\nvoid main()\n{\n    fs_Col = vs_Col;                         // Pass the vertex colors to the fragment shader for interpolation\n    vec2 center_MousePos = 2.f * (u_MousePos - 0.5f);\n    mat3 invTranspose = mat3(u_ModelInvTr);\n    vec4 p = vec4(center_MousePos.xy, 1, 1) * abs(u_CameraPos.z);\n    p = u_ViewProjInv * p;\n    \n    fs_Nor = vec4(invTranspose * vec3(vs_Nor), 0);          // Pass the vertex normals to the fragment shader for interpolation.\n    // Transform the geometry's normals by the inverse transpose of the\n    // model matrix. This is necessary to ensure the normals remain\n    // perpendicular to the surface after the surface is transformed by\n    // the model matrix.\n    \n    vec4 modelposition = u_Model * vs_Pos;   // Temporarily store the transformed vertex positions for use below\n    \n    float amp = 1.f - length(center_MousePos) + 1.f;\n    amp = length(center_MousePos) + 1.f;\n    vec2 dir = normalize(center_MousePos);\n    vec3 camDir = normalize(u_CameraPos).xyz;\n    vec3 perp_dir = cross(vec3(dir, 0), camDir);\n    vec3 test = cross(vec3(0,0,1), vec3(0,1,0));\n    float amt = dot(perp_dir.xy, modelposition.xy);\n    vec2 center = center_MousePos;\n    \n    fs_Pos = modelposition;\n    float height = getOffset(modelposition.xyz);\n\n    float delta = 0.00001;\n//    vec4 norm = vec4(getOffset(modelposition.xyz + vec3(delta,0.0,0.0)) - getOffset(modelposition.xyz + vec3(-delta,0.0,0.0)),\n//    getOffset(modelposition.xyz + vec3(0.0,delta,0.0)) - getOffset(modelposition.xyz + vec3(0.0,-delta,0.0)), getOffset(modelposition.xyz + vec3(0.0,0.0,delta)) - getOffset(modelposition.xyz + vec3(0.0,0.0,-delta)), 0.0);\n    \n    \n    vec3 tangent = normalize(cross(vec3(0,1,0),fs_Nor.xyz));\n    vec3 bitangent = normalize(cross(fs_Nor.xyz, tangent));\n    fs_TBN = mat3(tangent, bitangent, fs_Nor.xyz);\n\n    // get points in delta direction\n    vec3 p1 = modelposition.xyz + delta * tangent;\n    vec3 p2 = modelposition.xyz + delta * bitangent;\n\n    //estimate offset points at p1, p2\n    vec3 v1 = getOffset(p1) * normalize(p1) + normalize(p1);\n    vec3 v2 = getOffset(p2) * normalize(p2) + normalize(p2);\n    \n    //fs_Nor = vec4(fs_TBN *  norm.xyz, 1.0);\n    fs_LightPos = lightPos;\n    modelposition.xyz += height * fs_Nor.xyz;\n\n    vec4 norm = vec4(0.0);\n    norm.xyz = normalize(cross(v1 - modelposition.xyz, v2 - modelposition.xyz));\n    \n    fs_WorldPos = modelposition;\n    fs_LightVec = lightPos - modelposition;  // Compute the direction in which the light source lies\n    \n    //norm = normalize(norm + vec4(0.0,0.0,0.0,0.0));\n    fs_Nor = norm;\n\n    gl_Position = u_ViewProj * modelposition;// gl_Position is a built-in variable of OpenGL which is\n    // used to render the final positions of the geometry's vertices\n    \n}\n"},3207:e=>{e.exports="#version 300 es\n\n// This is a fragment shader. If you've opened this file first, please\n// open and read lambert.vert.glsl before reading on.\n// Unlike the vertex shader, the fragment shader actually does compute\n// the shading of geometry. For every pixel in your program's output\n// screen, the fragment shader is run for every bit of geometry that\n// particular pixel overlaps. By implicitly interpolating the position\n// data passed into the fragment shader by the vertex shader, the fragment shader\n// can compute what color to apply to its pixel based on things like vertex\n// position, light position, and vertex color.\nprecision highp float;\n\nuniform vec4 u_Color; // The color with which to render this instance of geometry.\nuniform vec4 u_SecondaryColor; // The color with which to render this instance of geometry.\n\nuniform vec4 u_CameraPos; // The color with which to render this instance of geometry.\nuniform int u_NumericalNorm;\nuniform vec3 u_Resolution;\n\n// These are the interpolated values out of the rasterizer, so you can't know\n// their specific values without knowing the vertices that contributed to them\nin vec4 fs_Nor;\nin vec4 fs_LightVec;\nin vec4 fs_Col;\nin vec4 fs_WorldPos;\nin vec4 fs_LightPos;\nin vec4 fs_Pos;\nuniform float u_Clouds;\nuniform mat4 u_ViewProjInv;    // The matrix that defines the camera's transformation.\n\nuniform vec2 u_MousePos;\n\nuniform float u_Time;\nout vec4 out_Col; // This is the final output color that you will see on your\n// screen for the pixel that is currently being processed.\n\n\nfloat hash3(vec3 v)\n{\n    return fract(sin(dot(v, vec3(24.51853, 4815.44774, 32555.33333))) * 3942185.3);\n}\n\nvec4 noise3(vec3 v)\n{\n    //Adapted from IQ: https://www.iquilezles.org/www/articles/morenoise/morenoise.htm\n    vec3 intV = floor(v);\n    vec3 fractV = fract(v);\n    vec3 u = fractV*fractV*fractV*(fractV*(fractV*6.0-15.0)+10.0);\n    vec3 du = 30.0*fractV*fractV*(fractV*(fractV-2.0)+1.0);\n    \n    float a = hash3( intV+vec3(0.f,0.f,0.f) );\n    float b = hash3( intV+vec3(1.f,0.f,0.f) );\n    float c = hash3( intV+vec3(0.f,1.f,0.f) );\n    float d = hash3( intV+vec3(1.f,1.f,0.f) );\n    float e = hash3( intV+vec3(0.f,0.f,1.f) );\n    float f = hash3( intV+vec3(1.f,0.f,1.f) );\n    float g = hash3( intV+vec3(0.f,1.f,1.f) );\n    float h = hash3( intV+vec3(1.f,1.f,1.f) );\n    \n    float k0 =   a;\n    float k1 =   b - a;\n    float k2 =   c - a;\n    float k3 =   e - a;\n    float k4 =   a - b - c + d;\n    float k5 =   a - c - e + g;\n    float k6 =   a - b - e + f;\n    float k7 = - a + b + c - d + e - f - g + h;\n    \n    \n    vec3 dv = 2.0* du * vec3( k1 + k4*u.y + k6*u.z + k7*u.y*u.z,\n                             k2 + k5*u.z + k4*u.x + k7*u.z*u.x,\n                             k3 + k6*u.x + k5*u.y + k7*u.x*u.y);\n    \n    return vec4(-1.f+2.f*(k0 + k1*u.x + k2*u.y + k3*u.z + k4*u.x*u.y + k5*u.y*u.z + k6*u.z*u.x + k7*u.x*u.y*u.z), dv);\n}\n\nvec4 fbm3(vec3 v, int octaves, float amp, float freq, float pers, float freq_power)\n{\n    vec2 center_MousePos = 2.f * (u_MousePos - 0.5f);\n    float sum = 0.f;\n    vec3 dv = vec3(0.f,0.f,0.f);\n    float speed = 0.01f;\n    for(int i = 0; i < octaves; ++i)\n    {\n        amp *= pers;\n        freq *= freq_power;\n        vec4 noise = noise3((v) * freq);\n        sum += amp * noise.x;\n        dv += amp * noise.yzw;\n    }\n    return vec4(sum, dv);\n}\n\nfloat getBias(float t, float bias)\n{\n    return t / ((((1.f / bias) - 2.f * (1.f - t)) + 1.f));\n}\n\n\nfloat sphere(vec3 p, float s) {\n    return length(p) - s;\n}\n\nfloat twistSphere( vec3 p )\n{\n    const float k = 4.f; // or some other amount\n    float c = cos(k*p.y);\n    float s = sin(k*p.y);\n    mat2  m = mat2(c,-s,s,c);\n    vec3  q = vec3(m*p.xz,p.y);\n    return sphere(q, 1.0);\n}\n\n//taken from http://iquilezles.org/www/articles/smin/smin.htm\n//intersect\nfloat smax( float a, float b, float k )\n{\n    float h = max(k-abs(a-b),0.0);\n    return a > b ? a + h*h*0.25/k : b + h*h*0.25/k;\n}\n\nfloat differenceCSG(float d1, float d2) {\n    return max(-d1, d2);\n}\n\nfloat map(vec3 p, int octaves)\n{\n    if(abs(p.x) > 20.0 || abs(p.z) > 20.0 || abs(p.y) > 20.0) {\n        return 9e10;\n    }\n    \n    float time = abs(1.9 * sin(0.0001 * u_Time));\n    float dist = 0.f;\n    dist = sphere(p, 1.5);\n    //dist += 0.5 * sin(4.f*p.x)*sin(4.f*p.y)*sin(2.f*p.z);\n    vec4 fbm = fbm3(p.xyz * 0.4f + time, octaves, 0.8f, 2.2f, 0.8f, 2.f);\n    float norm_fbm = 0.5 * (fbm.x + 1.0);\n    dist = norm_fbm;\n    dist = clamp(dist, 0.0,1.0);\n    //dist =sphere(p, 1.2);\n    float cloudSize = u_Clouds * 0.4;\n    float s = sphere(p, cloudSize) + 0.1 * norm_fbm;\n    dist = max(s, dist);\n    //dist = max(-fbm.x, dist);\n    return dist;\n}\nvec4 raycast(vec4 p, vec4 skyCol)\n{\n    float cloudSize = u_Clouds * 0.4 + 0.1;\n\n    float s = sphere(u_CameraPos.xyz, cloudSize);\n    float occDist = cloudSize - 0.11;\n    vec4 noise = fbm3(100.f * u_CameraPos.xyz, 3, 0.8f, 2.2f, 0.8f, 2.f);\n\n    float t = s; //s - 0.02 * noise.x;\n    vec4 rayDir = normalize(p - u_CameraPos);\n    float tmax = 5.f;\n    vec4 col = vec4(0.0);\n    for(int i = 0; i < 70; ++i)\n    {\n        vec3 pos = u_CameraPos.xyz + rayDir.xyz * t;\n        float density = map(pos, 4);\n        float occ = sphere(pos, 1.11);\n        if (-occ > density || occ < 0.0)\n        {\n            return vec4(0.0);\n        }\n        \n        if (occ > occDist || col.a > 0.9 || density < 0.005)\n            return col;\n\n        float densMax = 0.16;\n        if(density < densMax) {\n            //if (dist < 0.0) {\n            // if density isn't accumulating properly, it's prob bc steps are too big\n            float invDensity = (1.0 - density / densMax);\n            //col += vec4(1.0,1.0,1.0, 0.3 * (1.0 - density * 1.f));\n            vec3 lerpCol = mix(vec3(0.7, 0.8, 1.0), vec3(0.9,0.9,1.0), max(invDensity, 0.0));\n            col += vec4(invDensity * lerpCol * (1.0 - col.a), invDensity);\n            //}\n        }\n\n        \n        t += max(t * 0.001 + density * 0.1, 0.015);//+ 0.02 * abs(noise.x), 0.02);//max(0.02, 0.19 * (0.01 * noise3(pos).x));